import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useAuth } from './AuthContext';
import { useNavigate } from 'react-router-dom';
import ErrorBoundary from './ErrorBoundary';

const Dashboard = () => {
    const { auth, logout } = useAuth();
    const navigate = useNavigate();
    const [quote, setQuote] = useState('');
    const [joke, setJoke] = useState('');
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [profile, setProfile] = useState({
        name: auth.user?.name || '',
        email: auth.user?.email || '',
        signupDate: auth.user?.createdAt ? new Date(auth.user.createdAt).toLocaleDateString() : 'N/A'
    });
    const [updatingProfile, setUpdatingProfile] = useState(false);
    const [profileUpdateSuccess, setProfileUpdateSuccess] = useState(null);

    useEffect(() => {
        let mounted = true;
        const token = localStorage.getItem('token');

        const fetchData = async () => {
            if (!token) {
                navigate('/login', { replace: true });
                return;
            }

            try {
                const [quoteRes, jokeRes] = await Promise.all([
                    axios.get('https://api.freeapi.app/api/v1/public/quotes', {
                        headers: { Authorization: `Bearer ${token}` }
                    }),
                    axios.get('https://api.freeapi.app/api/v1/public/randomjokes', {
                        headers: { Authorization: `Bearer ${token}` }
                    })
                ]);

                if (mounted) {
                    setQuote(quoteRes.data.data?.[0]?.quote || 'No quote available');
                    setJoke(jokeRes.data.data?.body || 'No joke available');
                    setLoading(false);
                }
            } catch (error) {
                if (mounted) {
                    setError('Failed to load content');
                    setLoading(false);
                }
            }
        };

        fetchData();
        return () => { mounted = false; };
    }, []);

    const handleProfileUpdate = async () => {
        setUpdatingProfile(true);
        setProfileUpdateSuccess(null);
        try {
            await axios.put('https://api.freeapi.app/api/v1/users/update', profile, {
                headers: { Authorization: `Bearer ${auth.token}` }
            });
            setProfileUpdateSuccess('Profile updated successfully!');
        } catch (error) {
            setProfileUpdateSuccess('Failed to update profile. Please try again.');
        } finally {
            setUpdatingProfile(false);
        }
    };

    return (
        <ErrorBoundary>
            <div className="min-h-screen bg-gray-100 dark:bg-gray-900 text-gray-800 dark:text-white">
                <div className="max-w-4xl mx-auto p-6">
                    <div className="bg-white dark:bg-gray-800 rounded-lg shadow-lg p-6">
                        <h1 className="text-2xl font-bold mb-4">Hello, {profile.name}!</h1>
                        
                        {/* Profile Information */}
                        <div className="mb-6 p-4 bg-gray-50 dark:bg-gray-700 rounded-lg">
                            <h2 className="text-xl font-bold mb-3">Profile Information</h2>
                            <div className="space-y-3">
                                <div>
                                    <label className="block text-sm font-medium">Name</label>
                                    <input
                                        type="text"
                                        value={profile.name}
                                        onChange={(e) => setProfile({...profile, name: e.target.value})}
                                        className="mt-1 w-full p-2 border rounded-md dark:bg-gray-800"
                                    />
                                </div>
                                <div>
                                    <label className="block text-sm font-medium">Email</label>
                                    <input
                                        type="email"
                                        value={profile.email}
                                        disabled
                                        className="mt-1 w-full p-2 border rounded-md bg-gray-100 dark:bg-gray-600"
                                    />
                                </div>
                                <div>
                                    <label className="block text-sm font-medium">Signup Date</label>
                                    <p className="mt-1">{profile.signupDate}</p>
                                </div>
                            </div>
                            <button
                                onClick={handleProfileUpdate}
                                disabled={updatingProfile}
                                className="mt-4 w-full bg-blue-600 text-white py-2 rounded-md hover:bg-blue-700"
                            >
                                {updatingProfile ? 'Updating...' : 'Update Profile'}
                            </button>
                            {profileUpdateSuccess && (
                                <p className="mt-2 text-center text-sm">{profileUpdateSuccess}</p>
                            )}
                        </div>

                        {/* Quote and Joke Section */}
                        {loading ? (
                            <p>Loading content...</p>
                        ) : error ? (
                            <p className="text-red-500">{error}</p>
                        ) : (
                            <>
                                <div className="mb-4 p-4 bg-blue-100 dark:bg-blue-900 rounded-lg">
                                    <h2 className="text-lg font-semibold">Quote of the Day:</h2>
                                    <p>{quote}</p>
                                </div>
                                <div className="mb-4 p-4 bg-green-100 dark:bg-green-900 rounded-lg">
                                    <h2 className="text-lg font-semibold">Random Joke:</h2>
                                    <p>{joke}</p>
                                </div>
                            </>
                        )}

                        <button
                            onClick={logout}
                            className="mt-6 w-full bg-red-600 text-white py-2 rounded-md hover:bg-red-700"
                        >
                            Logout
                        </button>
                    </div>
                </div>
            </div>
        </ErrorBoundary>
    );
};
export default Dashboard;
